"""
Given a string S and a string T, count the number of distinct subsequences of T in S.

A subsequence of a string is a new string which is formed from the original string by deleting some (can be none) of the characters without disturbing the relative positions of the remaining characters. (ie, "ACE" is a subsequence of "ABCDE" while "AEC" is not).

Here is an example:
S = "rabbbit", T = "rabbit"

Return 3.

也就是将 S中 一些单词删除后 能够变为 T;  求有几种可能;

类似： 97  72 
都是将S1转换为S2; 

**72笔记!!!** -> **划分问题**

"""



"""
S1:   dfs+cache   Q: 递归过深   beats 87%
    
    1. 划分子问题 找到最优子结构;  2. 重叠子问题; 

    * 问题分析：
            m = len(S) n = len(T)  m > n  (其余case暂时不考虑)
            即 Cm <m-n>  和97中规模类似; 也是向目标串T移动;   **求所有case**

            ???---???

    * 问题分解 :
            对于S中char,依次确认是否使用该字符;

            f(i) =  use S[i]  or  !use S[i] 
                    f(i+1)         f(i)
    
    * 伪代码：

            dfs(S_b , T_b):
                if len(s_b) == len(t_b) :
                    s_b == t_b  # 直接比较
                if  len(s_b) < len(t_b) :
                    Fasle

                # use S[s_b]:
                if S[s_b] == T[t_b]:
                    dfs(s_b+1,t_b+1)
                # not use
                    dfs(s_b+1,t_b)

            dfs 返回值：
                    此处只是要求可能case数;  所以dfs(s_b,t_b)直接返回其结果即可;

    * 解还原： 
            dfs中还是返回该步结果;
            可以在该dfs中构造  使用不使用 S[s_b]

    * Cache ： 
            不使用cache：   TLE :51 / 63 test cases passed.

    
    * 递归层次过大！： 
            如何处理？
            可以先对S遍历将那些不再T中的char直接移除？？？  pass

            但是这样也是仅仅针对个别case;



"""


class Solution1(object):
    def numDistinct(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        """
        # 解决递归深case  减枝 预处理将s中不再t中的元素剔除

        tt = set(t)
        ss = [ i for i in s if i in tt]
        s = "".join(ss)

        cache = dict()   # (s_b,t_b):num   -1 not valid
        ans = self.recur(s,t,0,0,cache)
        return ans


    def recur(self,s,t,s_b,t_b,cache):
        """
        递归处理：
        子问题 计算s[s_b:]  t[t_b:] 能够产生的可能数;

        递归终止：
                1. 当 len(s) <= len(t) : 可以直接判断
                2. 越界处理：传入的s_b t_b 可能越界：
                        t_b 越界表示已经match
                        t_b 未越 s_b越界 表示还剩not match; 失败
        """
        # cache
        if cache.get((s_b,t_b),-1) != -1:
            return cache[(s_b,t_b)]

        if t_b >= len(t): # one case
            cache[(s_b,t_b)] = 1
            return 1
        if s_b >= len(s) : # t end s not end
            cache[(s_b,t_b)] = 0
            return 0

        if (len(s)- s_b) < (len(t)-t_b) :   #s short
            return 0
        if (len(s)- s_b) == (len(t)-t_b) :  # s== t
            return 1 if s[s_b:] == t[t_b:] else 0

        # len(s) > len(t)
        ans = 0
        if s[s_b] == t[t_b] :
            ans += self.recur(s,t,s_b+1,t_b+1,cache)  # use

        ans += self.recur(s,t,s_b+1,t_b,cache)  #not use 

        cache[(s_b,t_b)] = ans
        return ans

 

"""

 S2:  DP 从下到上  o(n^2)  空间o(n^2) 或者o(n)


    * 问题分解： 
                还是和S1中类似，本质就是对于S中的每个char选择or不选择;

                f(i,j) : s[0:i] 和 t[0:j] 能够生成的结果数(子问题),  求解S和T的所有可能数就等价于 f(len(s),len(t)) 

                f(i,j) = f(i-1,j-1)&&s[i]==t[j]    +    f(i-1,j)  (注意此并不限制s[i]!=t[j]二者即使match也要执行此， 不match也得执行)  
                          也就是说： s[i] == t[j] 那么我可以选择 s[i]和t[j] match 即f(i-1,j-1) 也可以选择不match 即 f(i-1,j)
                                     s[i] != t[j]   则只能选择 s[i]和t[j] 失配即 使用f(i-1,j) 

    * 伪代码： 
            使用二维矩阵 stat  只会使用到下半矩阵;  i >= j 
                f(i,j)  会使用到其 上方f(i-1，j) 和 西北方向f(i-1,j-1)
                所以遍历是只要对于第一列单独处理  然后依次每行处理即可;  第一列f(i,j) 只要判断s[0:i] == t[0]即可

                for i in 1... len(s):
                    for j in len(t):
                        s[i] == t[j]  stat[i-1][j-1]   ()
                        s[i] != t[j]  stat[i-1][j] 

    * 复杂度：  o(n^2)
                空间： o(n^2)  由于只使用到上一行stat  优化后o(n)

                * 滚动数组, 使用一维数组
                        f(i,j) = f(i-1,j) + f(i-1,j-1)&&s[i]==t[j]
                        使用直接使用一维数组f
                        f[j] = f[j] +=f[j-1] if s[i]==t[j]
                        

    * Q； 
        1. 注意 stat矩阵中初值选择;
                `stat[i][0] = stat[i-1][0]+1 if  s[i] == t[0] else stat[i-1][0]`
                 当我们计算stat[i][0]时， 如果s[i]!=t[0] 则该字符必然需要del,所以该字符和没有一样, 直接使用s[i-1][0]即可；
                                        但是当s[i]==t[0]  对于该字符我们可以选择使用 也可以选择不使用 所以 s[i-1][0]+1

    * 运行时间： 
                不使用减枝：  326 ms  beats 11%
                使用减枝：   95ms  beats 95%
                   同样减枝后 还是比 dfs+cache 优些


"""


class Solution2(object):
    def numDistinct(self, s, t):  

        # 减枝
        tt = set(t)
        ss = [ i for i in s if i in tt]
        s = "".join(ss) 

        if len(s) < len(t) : 
            return 0
        if not t :  # 防止越界
            return 1

        m,n = len(s) ,len(t)
        stat = [[0]*n  for i in range(m)]  # m*n

        # colum 1
        stat[0][0] = 1 if s[0] == t[0] else 0
        for i in range(1,m): # 注意第一列初值选择
            stat[i][0] = stat[i-1][0]+1 if  s[i] == t[0] else stat[i-1][0]

        # dp
        for i in range(1,m):
            for j in range(1,n):   #cal  stat[i][j]
                if s[i]== t[j]:
                    stat[i][j] += stat[i-1][j-1]
                #else :  不是else 关系
                stat[i][j] += stat[i-1][j]
        #print(stat)
        return stat[-1][-1]












